import TodoListItem from "./components/TodoListItem.tsx";

function App() {
  const dummyData: Todo[] = [
    { text: "task 1", completed: false },
    { text: "another task", completed: false },
  ];
  return (
    <>
      <TodoListItem todo={dummyData[0]} />
      <TodoListItem todo={dummyData[1]} />
    </>
  );
}

export default App;
